import logo from "./logo.svg";
import "./App.css";

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <script
          defer="defer"
          src="https://hlive.azureedge.net/hlive-button-script/minichat.bundle.js"
        ></script>
      </header>
      <body>
        <script>
          {document.addEventListener("DOMContentLoaded", function () {
            var hchat = new HliveChat();
          })}
        </script>
      </body>
      <script>
        {document.addEventListener("DOMContentLoaded", function () {
          var hchat = new HliveChat({
            style: {
              bottom: "100px", // default: '30px'
              right: "30px", // default: '30px'
            },
            language: "en", // default: 'en'
            country: "IT", // default: 'IT'
          });
        })}
      </script>
    </div>
  );
}

export default App;
